import Head from 'next/head'
import Title from '../components/title/Title.js'
import PageContainer from '../components/container/PageContainer.js'
import ContentContainer from '../components/container/ContentContainer.js'
import SectionContainer from '../components/container/SectionContainer.js'
import { motion } from 'framer-motion'
import Paragraph from '../components/paragraph/Paragraph.js'
import Button from '../components/button/Button.js'

export default function Termine() {

  const variants = {
    basic: {
      enter: { y: 0, opacity: 1 },
      exit: { y: 50, opacity: 0 }
    },
  };

  return (
    <div>
    <PageContainer withFooter={true} menuTypeLanding={false} menuVisibility={true}>
      <ContentContainer>

      <SectionContainer>
        <Title title="Termine" caps={false} />
        <Paragraph sectionTitle={false} title="Aktuelle Termine unserer Konzerte in Lüneburg und Umgebung." text="Aus Anlass der Covid-19 Pandemie ist es uns aktuell nicht möglich, einen Ausblick auf künftige Veranstaltungen unseres Chores zu geben.

Sobald wir wieder Konzerte geben dürfen, informieren wir Sie an dieser Stelle darüber.

Bleiben Sie gesund und uns gewogen.

Ihr Chor Oregano." />

      </SectionContainer>

      </ContentContainer>
    </PageContainer>
    </div>
  )
}
